Let's think step by step. To find the equation of the line, we need to eliminate the parameter $t$ from the position vector formula. By doing so, we get:

\begin{align*}
y &= -1 + 3t \\
y - (-1) &= 3(x - 8) \\
y + 1 &= 3x - 24
\end{align*}

Now, let's identify the slope and y-intercept of the line. The slope is $m=3$, and the y-intercept is found by setting $x=0$:

\begin{align*}
y + 1 &= 3(0) - 24 \\
y &= -25 \\
b &= -19
\end{align*}

Therefore, the ordered pair $(m,b)$ representing the slope and y-intercept of this line is $\boxed{\left(\dfrac{3}{2}, -19\right)}$.
